    "system_table_automated_reports_errors.email_missing_recipient": "Mindestens ein E-Mail Empfänger des automatischen Berichts muss festgelegt werden.",
    "agGrid.export.dialog.help2": "<p>Beim Export von Zahlen, Daten, Zeiten und Verweisen in Excel Tabellen werden die entsprechenden Excel Zellenformate unterstützt. Excel zeigt die Inhalte entsprechend seinen Einstellungen. Das bedeutet also, wenn das Datum als \"1 January 2016\" exportiert wird, aber Excel in der deutschen Zeitzone geöffnet ist, so wird das Datum als \"1. Januar 2016\" angezeigt.<br>\nJede Tabelle wird mit einer zusätzlichen Spalte exportiert: \"Datensatz erstellt am\". Der Wert in dieser Spalte speichert das Erstellungsdatums des Datensatzes, welches für das Filtern von Big Data verwendet wird.</p>\n<p>Zugriff auf Mediendateien (Bilder, Videos, Audiodateien, Dokumente) nach dem Download:</p>\n<ul>\n<li>Export ohne Anhänge:<br>\nin diesem Fall wird die URL der Mediendateien in der .csv oder .xlsx Datei gespeichert. Falls eine Tabellenzelle mehrere Dateien enthält, so werden die URLs mit einem „|“ getrennt.<br>\nBeispiel: “http://ginstr/image1.jpg|http://ginstr/image2.jpg”.\nDiese Links stehen zur Verfügung, bis die Anhänge (oder die gesamte Zeile, die solche Anhänge enthält) in der ginstr cloud gelöscht werden.</li>\n<br>\n<li>Export mit Anhängen:\n<ul>\n<br>\n<li>Tabellen, die nicht zu einer ginstr app gehören:<br>\nIn diesem Fall wird die .csv / .xlsx Datei im Bezug auf die Links zu den geeigneten Dateien im Archiv-Ordner gespeichert. So bedeutet z.B. \"picture/image1.jpg\", dass diese Datei innerhalb des .zip Archivs mit folgendem Pfad gesetzt ist: \"/pictures/image1.jpg\".<br>\nDiese Links stehen zur Verfügung, bis die Anhänge (oder die gesamte Zeile, die solche Anhänge enthält) in der ginstr cloud gelöscht werden.</li>\n<br>\n<li>Tabellen, die zu einer ginstr app gehören:<br>\nIn diesem Fall wird „pictures/image1.jpg“ von der \"Kunden\" Tabelle im Archiv unter folgendem Pfad gespeichert: „/kunden/pictures/image1.jpg“.<br>\nWie für den Export ohne Anhänge gilt: wenn mehrere Dateien in einer einzelnen Zelle einer ginstr Tabelle gespeichert sind, so werden sie mit einem \"|\" Trennzeichen angezeigt.<br>\nBeispiel: \"Bilder/image1.jpg|image2.jpg“<br>\nDiese Links stehen zur Verfügung, bis die Anhänge (oder die gesamte Zeile, die solche Anhänge enthält) in der ginstr cloud gelöscht werden.</li>\n</ul>\n</li>\n</ul>",
    "agGrid.export.dialog.help1": "Diese Funktion wird von vielen Kunden oft zusätzlich zur Datensicherung in der ginstr cloud verwendet.\nBeim Export-Format .csv wird jede Tabelle als separate .csv Datei dargestellt. Beim Export-Format .xlsx wird jede Tabelle als separates Blatt innerhalb einer einzigen .xlsx Datei dargestellt.\n<ul>\n<li>Sprache:<br>\nDie meisten ginstr apps sind in mehreren Sprachen verfügbar. Die Sprachauswahl betrifft nicht nur die Benutzeroberfläche der Anwendungen auf dem Handy, sondern auch die Überschriften der Tabellen. Mit dieser Option können Sie die Sprache auswählen, in der die Überschriften der heruntergeladenen Tabellen in der  .csv oder  .xlsx Datei gespeichert werden sollen.<br>\nDer Standardwert ist in den Einstellungen des Benutzers im ginstr web definiert.</li>\n<br>\n<li>Zeitformat:<br>\nginstr unterstützt mehrere Zeitformate. Diese Option ermöglicht die Auswahl eines Zeitformats für die Daten, die heruntergeladen werden sollen. Dies könnte dann relevant sein, wenn die Software, die zur Weiterverarbeitung der heruntergeladenen Daten verwendet wird, diesbzgl. konkrete Anforderungen an das Zeitformat hat.<br>\nDer Standardwert ist abhängig von den Einstellungen des Benutzers in seiner ginstr web Einstellungen.</li>\n<br>\n<li>Datumsformat:<br>\nginstr unterstützt mehrere Datumsformate. Diese Option ermöglicht die Auswahl eines Datumsformats für die Daten, die heruntergeladen werden sollen. Dies könnte relevant sein, wenn die Software, die zur Weiterverarbeitung der heruntergeladenen Daten verwendet wird, diesbzgl. konkrete Anforderungen an das Zeitformat hat.<br>\nDer Standardwert ist abhängig von den Einstellungen des Benutzers in seiner ginstr web Einstellungen.</li>\n<br>\n<li>Zahlenformat:<br>\nginstr unterstützt mehrere Zahlenformate. Diese Option ermöglicht die Auswahl eines Zahlenformats für die Daten, die heruntergeladen werden sollen. Dies könnte relevant sein, wenn die Software, die zur Weiterverarbeitung der heruntergeladenen Daten verwendet wird, diesbzgl. konkrete Anforderungen an das Zahlenformat hat.<br>\nDer Standardwert ist abhängig von den Einstellungen des Benutzers in seiner ginstr web Einstellungen.</li>\n<br>\n<li>Zeitzone:<br>\nginstr speichert intern alle Daten in der UTC-Zeitzone; dies ist die universelle, weltweit gleiche Zeit.<br>\nBevor der Bildschirm das Datum und die Uhrzeit anzeigt, wird jedes Datum und jede Uhrzeit in die vom Benutzer in seinem ginstr web Benutzerkonto definierte Zeitzone umgerechnet.</li>\n</ul>",
    "app_waehlerBuildersYardAssetManagement_optitime_invalid_date_format": "Ungültiger Datumswert",
