    "autoreport.table.dialog.helpcontent": "<br>\n<p>Hier können automatische Berichte konfiguriert werden, die auf Basis der in den zugehörigen Tabellen gespeicherten Werte automatisch zu festgelegten Zeitpunkten generiert und versendet werden.</p>\n<p>Jede Definition eines automatischen Berichts wird in einer separaten Zeile in der Systemtabelle \"System: Automatische Berichte\" gespeichert. Dort können die Einstellungen eines jeden Berichts jederzeit geändert werden.</p>\n<p>Alle automatischen Berichte werden als E-Mail mit Dateianhang versendet.</p>\n<p>Sofern bei der Generierung eines automatischen Berichts ein Fehler auftritt, können die Einzelheiten des Fehlers in der Systemtabelle \"System: Automatische Berichte - Fehler\" abgerufen werden.</p>\n<p>Folgende Optionen stehen für das Konfigurieren eines automatischen Berichts zur Verfügung:</p>\n<ul>\n<li>Berichtsname<br>\nHier kann der Name des automatischen Berichts festgelegt werden. Diese Angabe ist erforderlich.</li>\n<br>\n<li>AN<br>\nHier können die E-Mail Adressen eingegeben werden, an welche der Bericht versendet werden soll. Diese Angabe ist erforderlich.</li>\n<br>\n<li>CC<br>\nHier können die E-Mail Adressen eingegeben werden, an welche der Bericht als Kopie versendet werden soll.</li>\n<br>\n<li>BCC<br>\nHier können die E-Mail Adressen eingegeben werden, an welche der Bericht als Blindkopie versendet werden soll.</li>\n<br>\n<li>Betreff<br>\nHier kann der Betreff-Text für die E-Mail eingegeben werden. Diese Angabe ist erforderlich. Werkseinstellung: \"$Berichtstyp &ndash; vom $DatumVon bis $DatumBis\".<br>\nAuf der rechten Seite des Eingabefelds befindet sich ein Auswahlfeld mit allen zur Verfügung stehenden Stoppvariablen. Diese Stoppvariablen werden beim Erstellen eines Berichts mit den jeweils aktuellen Daten befüllt.<br>\nFolgende Stoppvariablen stehen zur Verfügung:</li>",
