    "LABEL_STARTING_VALUE": "Startwert",
    "autoreport.pentaho.dialog.helpcontent3": "<br>\n<li>Zeitzone<br>\nHier kann die Zeitzone festgelegt werden, welche in den automatischen, formatierten Berichten verwendet werden soll.</li>\n<br>\n<li>Tausender-Trennzeichen<br>\nHier kann das Tausender-Trennzeichen festgelegt werden, welche in den automatischen, formatierten Berichten verwendet werden soll.</li>\n<br>\n<li>Internationale Telefon-Ländervorwahl<br>\nHier kann das Format der internationalen Telefon-Ländervorwahl festgelegt werden, welches in den automatischen, formatierten Berichten verwendet werden soll.</li>\n</ul>\n<p>Filtern der Daten:</p>\nDie in einem Bericht zu berücksichtigenden Datensätze einer Tabelle hängen ab von den Filtereinstellungen.<br>\nFalls keine Filtereinstellungen zum Zeitpunkt des Definieren des automatischen, formatierten Berichts gesetzt waren wird der Bericht alle Datensätze des ausgewählten Zeitraums enthalten. Solch ein Bericht kann u.a. als automatische Datensicherung auf dem eigenen PC verwendet werden zusätzlich zu den regelmäßigen Datensicherungen, die ohnehin automatisch in der ginstr cloud durchgeführt werden.<br>\nWaren beim Definieren des automatischen, formatierten Berichts Filtereinstellungen gesetzt, so werden nur die Datensätze in den Bericht aufgenommen, die den Filterkriterien entsprechen. Spätere Änderungen der Filterkriterien werden in den automatischen Berichten nicht berücksichtigt.<br>\n??? Für den Fall, daß die Tabelle mindestens eine Spalte mit einer Datumsangabe oder mit Zeitstempeln enthält UND für den Fall, daß für diese Spalten ein Filter gesetzt wurde, werden nur Datensätze in dem Bericht berücksichtigt, die in dem in dem Parameter \"Wiederholung\" definierten Zeitraum liegen.",
    "autoreport.pentaho.dialog.helpcontent2": "<br>\n<li>Geplantes Datum<br>\nHier kann festgelegt werden, ab wann E-Mails mit automatischen, formatierten Berichten im Anhang versendet werden sollen. Abhängig von der gewählten Häufigkeit des Versands des Berichts wird dieser Zeitpunkt entsprechend wie folgt angepasst:<br>\n- Täglich &#9658; keine Anpassung<br>\n- Wöchentlich &#9658; Anfang nächster Woche<br>\n- Wochenende &#9658; nächsten Sonntag oder Montag abhängig von den Einstellungen zum Wochenbeginn<br> \n- Monatlich &#9658; am 1. des nächsten Monats<br>\nJedes Mal, wenn ein automatischer, formatierter Bericht neu angelegt oder geändert wird, wird sofort eine E-Mail mit einem Bericht versendet um die Einstellungen kontrollieren zu können.<br>\nDas geplante Datum kann in der Systemtabelle \"System: Automatische Berichte\" jederzeit geändert werden. Der Bericht wird zu den vorgegebenen Zeitpunkten in der vorgegebenen Wiederholungsrate gesendet.\nBerichte werden jeweils für die abgelaufene Zeitperiode generiert:<br>\n- Täglich: alle Daten von gestern<br>\n- Wöchentlich: alle Daten von letzter Woche<br>\n- Wochenende: alle Daten vom letzten Wochenende<br>\n- Monatlich: alle Daten aus dem letzten Monat</li>\n<br>\n<li>Typ<br>\nHier kann das Dateiformat des Berichts festgelegt werden. Folgende Dateiformate stehen zur Verfügung: CSV, EXCEL, PDF und RTF.</li>\n<br>\n<li>Sprache<br>\nHier kann die Sprache festgelegt werden, in welcher der automatische, formatierte Bericht erstellt werden soll.</li>\n<br>\n<li>Datumsformat<br>\nHier kann das Datumsformat festgelegt werden, welches in den automatischen, formatierten Berichten verwendet werden soll.</li>\n<br>\n<li>Zeitformat<br>\nHier kann das Zeitformat festgelegt werden, welches in den automatischen, formatierten Berichten verwendet werden soll.</li>",
    "tms.config.max.ccp": "Maximaler CCP",
    "WIDGET_QR_TEXT_READ_ONLY_HINT": "Bitte einen QR-Code einlesen",
    "aggrid.contextmenu.csvExportApplicationWithAttachments": "Alle Tabellen dieser ginstr app samt Anhängen exportieren (.zip)",
    "autoreport.pentaho.dialog.helpcontent1": "</ul>\n<p style=\"padding-left: 60px;\">$DatumVon - fügt das Startdatum der Zeitperiode dieses Berichts ein</p>\n<p style=\"padding-left: 60px;\">$DatumBis -fügt das Enddatum der Zeitperiode dieses Berichts ein </p>\n<p style=\"padding-left: 60px;\">$Berichtstyp - fügt den Berichtstyp ein (in diesem Fall: \"Formatierter Bericht\")</p>\n<p style=\"padding-left: 60px;\">$Berichtsname - fügt den im Eingabefeld \"Berichtsname\" festgelegten Namen des Berichts ein</p>\n<p style=\"padding-left: 60px;\">$AnforderndesBenutzerkonto – fügt den Benutzernamen des Benutzerkontos ein, von dem aus dieser automatische Bericht angefordert wurde</p>\n<ul>\n<li>E-Mail Nachricht<br>\nHier kann der Text eingegeben werden, der später im Textfeld der automatisch erzeugten E-Mail angezeigt werden soll. Die Eingabe eines Textes ist optional. Werkseinstellung: \"Dieser automatische Bericht wurde von $AnforderndesBenutzerkonto angefordert.\". Der Text kann jederzeit verändert werden. Die in der Betreffzeile näher beschriebenen Stoppvariablen können mit selber Bedeutung auch im E-Mail Text verwendet werden. In der rechten oberen Ecke des Textfelds befindet sich ein Auswahlfeld mit allen zur Verfügung stehenden Stoppvariablen. Durch Anklicken können diese Stoppvariablen an der aktuellen Stelle der Schreibmarke eingefügt werden. Diese Stoppvariablen werden beim Erzeugen eines automatischen Berichts mit den jeweils aktuellen Daten befüllt.</li>\n<br>\n<li>Wiederholung<br>\nHier kann festgelegt werden, wie oft eine E-Mail mit dem formatierten, automatischen Bericht versendet werden soll.</li>\n<br>Folgende Wiederholungsoptionen stehen zur Verfügung:</li>\n</ul>\n<p style=\"padding-left: 60px;\">Täglich – die E-Mail wird jeden Tag zur festgelegten Uhrzeit versendet und enthält einen Bericht mit den Daten des Vortages</p>\n<p style=\"padding-left: 60px;\">Wöchentlich - die E-Mail wird an jedem ersten Tag einer Woche zur festgelegten Uhrzeit versendet und enthält einen Bericht mit den Daten der Vorwoche. Abhängig von den Einstellungen des Benutzerkontos, von dem aus der Bericht angefordert wurde,  ist der erste Tag einer Woche entweder ein Montag oder ein Sonntag.</p>\n<p style=\"padding-left: 60px;\">Wochenende - die E-Mail wird an jedem ersten Tag einer Woche zur festgelegten Uhrzeit versendet und enthält einen Bericht mit den Daten des vorigen Wochenendes. Abhängig von den Einstellungen des Benutzerkontos, von dem aus der Bericht angefordert wurde,  ist der erste Tag einer Woche entweder ein Montag oder ein Sonntag.</p>\n<p style=\"padding-left: 60px;\">Monatlich - die E-Mail wird an jedem ersten Tag eines Monats zur festgelegten Uhrzeit versendet und enthält einen Bericht mit den Daten des Vormonats.</p>\n<ul>\n<li>Status<br>\nHier kann festgelegt werden, ob dieser Bericht zu den definierten Zeiten versendet werden soll oder nicht. Wenn das Versenden des Berichts aktiviert ist, so werden zu den festgelegten Zeitpunkten automatische Berichte versendet. Ist das Versenden des Berichts hingegen deaktiviert, so werden keine Berichte versendet. Diese Einstellung kann jederzeit in der Systemtabelle \"System: Automatische Berichte\" geändert werden.</li>\n<br>\n<li>Jeden Bericht in eine separate Datei exportieren<br>\nHiermit kann festgelegt werden, ob jeder formatierte, automatische Bericht in einer eigenen Datei versendet werden soll (zusammengefasst in einer ZIP-Datei) oder ob alle formatierten Berichte in einer gemeinsamen Datei zusammengefasst und versendet werden sollen.</li>",
    "accountConfig.design.user.logo.file.choose": "Logo-Datei auswählen",
