    "deviceConfig.defaults.name.invalid": "Der Name ist ungültig",
    "map.helpTip.content": "<p>Mit diesem Kartenportlet k&ouml;nnen Sie GPS-Positionen auf einer Karte sehen, welche aus erfassten Daten aus der aktiven ginstr-Tabelle, mit einer oder mehreren Spalten mit dem Datentyp 'GPS' oder Geofences, gebildet werden.</p>\n<ul>\n<li>Eine \"GPS\" -Spalte beschreibt eine spezifische Koordinate, z.B. -12.340580, 40.234809.</li>\n<li>Ein \"Geofence\" zeigt einen Bereich auf der Karte an. Dieser Bereich kann benannt werden. Dieser Geofence-Name kann dann beispielsweise, statt der numerischen GPS-Koordinate, in ginstr Apps oder in ginstr web verwendet werden. Dadurch k&ouml;nnen in ginstr Apps erstellte Berichte besser lesbar gemacht werden.</li>\n</ul>\n<p>Jeder Datensatz, der in einer Tabelle ausgew&auml;hlt wird, wird in diesem Kartenportlet als \"Pushpin\" oder \"Geofence\" angezeigt.</p>\n<p>Pushpins werden angezeigt, wenn Sie Datens&auml;tze in Tabellen mit sichtbaren GPS-Datentypspalten ausw&auml;hlen.</p>\n<p>Wenn Tabellen mehrere Spalten mit einem GPS-Datentyp haben, wird jeder von ihnen angezeigt, wenn die Spalte sichtbar ist.</p>\n<p>Ein Geofence wird angezeigt, wenn Sie einen Datensatz in der Tabelle mit einem Zeiger auf \"System: Geofences\" ausw&auml;hlen und wenn im \"Dropdown-Men&uuml;\" die Option \"Geofences\" ausgew&auml;hlt ist oder &uuml;ber das \"Rechte Maustaste-Men&uuml;\".</p>\n<p><strong>Kartennavigation</strong></p>\n<p>Sie haben die folgenden Optionen zum Verschieben der Karte:</p>\n<ul>\n<li>Tastaturpfeile:<br /> Verschieben Sie die Karte in kleinen Schritten entsprechend nach rechts, links, oben und unten </li>\n</ul>\n<ul>\n<li>Umschalt + Tastatur Pfeile:<br /> f&uuml;hrt die gleichen Bewegungen aus, aber in mittleren Schritten</li>\n</ul>",
