    "APP_NOT_FOUND_ERROR": "Die App wurde nicht gefunden; bitte den Bildschirm aktualisieren",
    "ag-table.helpTip.content": "<h3>Optionen nach dem Anklicken der Tabelle mit der rechten Maustaste</h3>\n\n \n\nWird die Tabelle in diesem Portlet an einer beliebigen Stelle in einem Datensatz oder in der Überschrift mit der rechten Maustaste angeklickt, so öffnet sich ein Kontextmenü mit folgenden Optionen:\n\n<ul>\n\n<li>Spalten anzeigen / verbergen:<br>\n\nmit dieser Option lässt sich festlegen, welche Spalten der Tabelle sichtbar und welche unsichtbar sein sollen;<br>\n\ndas Verbergen einer Spalte löscht die darin enthaltenen Daten nicht; sie werden lediglich nicht mehr angezeigt.<br>\n\nWird eine Spalte mit einem Pflichtfeld versteckt, so lassen sich keine Datensätze mehr manuell zur Tabelle hinzufügen, da das Pflichtfeld nicht mehr eingegeben werden kann.</li><br>\n\n<li>Tabellenspalteninhalt konfigurieren:<br>\n\nDiese Option wird NICHT für Tabellen angezeigt, die zu einer ginstr app gehören.;<br>\n\nfür alle anderen Tabellen kann man mit dieser Option neue Spalten zu einer Tabelle hinzufügen und bestehende Spalten einer Tabelle löschen. <br>\n\nWird eine Spalte gelöscht so werden auch die darin enthaltenen Daten gelöscht. Sie können NICHT wiederhergestellt werden.</li><br>\n\n<li>Tabelle an Portletgröße anpassen:<br>\n\nMit dieser Option lassen sich die Spalten einer Tabelle über die volle Breite des Portlets so verteilen, daß alle Spalten ohne Scrollen angezeigt werden.</li><br>\n\n<li>Spaltenbreiten an Spaltenüberschriften anpassen:<br>\n\nMit dieser Option wird die Breite jede Spalte an die jeweilige Spaltenüberschrift angepasst, so daß alle Überschriften vollständig sichtbar sind. Ist die Summe der Überschriften breiter als das Portlet so wird ein Scrollbalken angezeigt, mit dem der Portlet-Inhalt hin- und hergeschoben werden kann. Die Daten in den Spalten sind nach Anwendung dieser Option abhängig von deren Länge u. U. nicht vollständig sichtbar.</li><br>\n\n<li>Spaltenbreiten an Spalteninhalte anpassen:<br>\n\nMit dieser Option wird die Breite jeder Spalte an deren Inhalt samt Spaltenüberschrift angepasst so daß alle Daten und Spaltenüberschriften vollständig sichtbar sind. Ist die Summe der Spaltenbreiter größer als das Portlet so wird ein Scrollbalken angezeigt, mit dem der Portlet-Inhalt hin- und hergeschoben werden kann.</li><br>\n\n<li>Spalten während des Veränderns der Portletgröße laufend anpassen:<br>\n\nIst diese Option aktiviert, so werden beim Verändern der Spaltenbreite durch Ziehen der Trennlinie zwischen zwei Überschriften die Zellen unterhalb der Überschrift sofort mit angepasst. Ist diese Option nicht aktiviert, so wird nur die Zelle mit der Spaltenüberschrift verändert und die darunterliegenden Zellen werden erst nach dem Loslassen der linken Maustaste angepasst. Diese Funktion ist insbesondere hilfreich für Computer mit geringer Rechenleistung.</li><br>\n\n<li>Daten hochladen:<br>\n\nMit dieser Option lassen sich Daten aus Fremdprogrammen in ginstr web importieren. Gehört die Tabelle zu einer ginstr app mit mehreren Tabellen so lassen sich mit dieser Funktion auch Daten für alle Tabellen der App in einem Arbeitsgang importieren.<br>\n\nEnthalten die Zieltabellen Dateien von Bildern, Videos, Sprachnotizen oder Dokumenten so können diese Dateien in einem Arbeitsgang mit importiert werden. Darüber hinaus lassen sich auch alle Daten importieren, die zuvor mit der 'Daten herunterladen' Funktion exportiert wurden.</li><br>\n\n<li>Daten herunterladen:<br>\n\nMit dieser Option lassen sich Daten aus ginstr web als .csv oder Excel .xlsx Datei auf den eigenen Rechner laden. Gehört die Tabelle zu einer ginstr app mit mehreren Tabellen so lassen sich mit dieser Funktion auch Daten für alle Tabellen der App in einem Arbeitsgang exportieren.\n\nEnthalten die zu exportierenden Tabellen Dateien von Bildern, Videos, Sprachnotizen oder Dokumenten so können diese Dateien in einem Arbeitsgang mit exportiert werden.<br>\n\nSo können Sie u.a. eine private Sicherungskopie der in ginstr web gespeicherte Daten anlegen zusätzlich zu den Sicherungskopien, die ginstr web ohnehin erzeugt.</li>\n\n</ul>",
    "error.8056": "Ein Spaltenwert fehlt",
    "system_table_import_errors_fail_single_value": "Der Import ist fehlgeschlagen weil mehr als ein Datensatz vorhanden ist, jedoch nur 1 Datensatz erwartet wurde: {0}",
