    "totals.helpTip.content": "<h3>Berichtseinstellungen</h3>\n\nIn diesem Bildschirm lassen sich Berichte auf Basis der Daten im Tab 'Originaldaten' erstellen.<br/>\nPro Portlet können bis zu 20 unterschiedliche Berichte angelegt werden.<br/>\n<br/>\nIm obersten Eingabefeld kann der Name des Berichts festgelegt werden. Dieser Name wird auf dem Reiter oberhalb der Tabelle angezeigt. Der Berichtsname kann aus mehreren Wörtern bestehen.<br/>\n<br/>\nJede Zeile im Abschnitt 'Gruppierte Spalten' und im Abschnitt 'Nicht gruppierte Spalten' repräsentiert eine Spalte im Bericht.<br/>\nEinzelne Zeilen können vom Abschnitt 'Gruppierte Spalten' in den Abschnitt 'Nicht gruppierte Spalten' gezogen werden und umgekehrt.<br/>\nDarüber hinaus besteht die Möglichkeit eine Zeile innerhalb eines Abschnitts weiter nach oben oder weiter nach unten zu ziehen. Damit lässt sich die Reihenfolge der Spalten im Bericht festlegen.<br/>\n<br/>\n<u>Abschnitt 'Gruppierte Spalten'</u><br/>\nDie im Abschnitt 'Gruppierte Spalten' enthaltenen Spalten werden in der linken Hälfte des Berichts in der definierten Reihenfolge von links nach rechts angezeigt.<br/>\nDer Bericht wird nach allen Spalten, die die im Abschnitt 'Gruppierte Spalten' enthalten sind, sortiert.<br/>\nDie Sortierreihenfolge ist definiert durch die Reihenfolge der Spalten von links nach rechts.<br/>\nDurch Anklicken eines schwarzen Dreiecks in in dem Abschnitt lässt sich die Sortierung innerhalb der jeweiligen Spalte umkehren.<br/>\nFür jede im Abschnitt 'Gruppierte Spalten' enthaltene Spalte wird für jeden unterschiedlichen Inhalt eine Zeile mit Zwischenergebnissen angezeigt.<br/>\n<br/>\n<u>Abschnitt 'Nicht gruppierte Spalten'</u><br/>\nDieser Abschnitt legt die Reihenfolge der nicht gruppierten Spalten fest. Diese werden in der rechten Hälfte des Berichts in der definierten Reihenfolge von links nach rechts angezeigt.<br/>\nDurch Anklicken eines schwarzen Dreiecks in dem Abschnitt lässt sich die Sortierung innerhalb der jeweiligen Spalte umkehren.<br/>\nDie im Abschnitt 'Gruppierte Spalten' festgelegte Sortierreihenfolge hat Priorität vor den Sortiereinstellungen im Abschnitt 'Nicht gruppierte Spalten'.<br/>\n<br/>\n<u>Abschnitt 'Optionen'</u><br/>\nIm Abschnitt 'Optionen' können folgende Einstellungen getrennt für die Anzeige am Bildschirm (definiert in der Spalte 'Web') und für den Export von Daten in .csv Dateien oder in Excel .xlsx Dateien (definiert in der Spalte 'Exportieren') festgelegt werden:\n<ul>\n<li>Zwischenergebnisse für jede Gruppierung anzeigen</li>\n<li>Gesamtergebnisse am Ende des Berichts anzeigen</li>\n<li>Anteile / Durchschnittswerte für jede Gruppierung anzeigen</li>\n<li>Anteile / Durchschnittswerte am Ende des Berichts anzeigen</li>\n<li>Sonstigen Inhalt zählen</li>\n<li>Checkboxen zählen</li>\n</ul>\nJede Option kann durch Anklicken des zugehörigen Icons aktiviert / deaktiviert werden.<br/>\n<br/>\n<u>Schaltflächen</u><br/>\nAm oberen Rand des Bildschirms gibt es folgende Schaltflächen:\n<ul>\n<li>Anwenden<br/>\nspeichert alle Einstellungen und wendet sie bei dem betreffenden Report sofort an;<br/>\nder Bericht wird neu angelegt sofern es ihn zuvor noch nicht gab</li>\n<li>Abbrechen<br/>\nverwirft alle Änderungen und stellt die vorherigen Einstellungen wieder her</li>\n<li>Löschen<br/>\nlöscht den ausgewählten Bericht; durch das Löschen eines Berichts werden weder Daten gelöscht noch werden andere Berichte davon beeinflusst.</li>\n</ul>",
