    "agGrid.export.dialog.help": " <p>Mit dieser Export-Funktion können in ginstr Tabellen gespeicherte Daten auf einen lokalen PC heruntergeladen werden.\n </p>\n <p>Zum Herunterladen der Daten bitte mit der rechten Maustaste an einer beliebigen Stelle die herunterzuladende Tabelle anklicken und danach die Menüoption &lsquo;Daten herunterladen&rsquo; anklicken. Nun wird dieses Popup-Fenster angezeigt.\n </p>\n <p>Folgende Optionen werden nun angeboten:\n </p>\n <ul>\n<li>Export Format:\n<ul>\n<br>\n<li>CSV:\n<br>Dateien mit der .csv Dateiendung werden häufig verwendet um Daten zwischen verschiedenen Programmen auszutauschen. Sollen in einer ginstr Tabelle gespeicherte Daten also z.B. in einer Dispositionssoftware, einem Buchhaltungsprogramm etc. weiterverarbeitet werden, so ist es sinnvoll, die Daten im .csv Format zu exportieren und diese .csv Datei dann wiederum in die Drittsoftware zu importieren.\n</li>\n<br>\n<li>Excel:\n<br>mit dieser Option lassen sich Microsoft Excel kompatible .xlsx Dateien erzeugen. Excel Version 2007 oder neuer ist erforderlich, um diese Dateien zu öffnen. In .xlsx Dateien können max. 1 Million Datensätze gespeichert werden.\n</li>\n</ul>\n</li>\n<br>\n<li>Anhänge berücksichtigen:\n<ul>\n<br>\n<li>Ja:\n<br>wird diese Option gewählt, so werden die Daten als .zip Datei heruntergeladen. Diese .zip Datei enthält mehrere Dateien:\n<br>- die .csv oder .xlsx Datei abhängig vom gewählten Format\n<br>- alle Mediendateien (z.B. .png Bilddateien, .wav Sound Dateien etc.).\n<br>Abhängig vom Betriebssystem des PCs und der Versionsnummer des Betriebssystems unterscheidet sich die Vorgehensweise, wie .zip Dateien explodiert werden können. Bei Fragen hierzu bitte den Systemadministrator ansprechen.\n</li>\n<br>\n<li>Nein:\n<ul>\n <li>es werden nur die Daten einer einzelnen Tabelle heruntergeladen: in diesem Fall wird abhängig vom gewählten Dateiformat eine .csv oder eine .xlsx Datei heruntergeladen\n </li>\n <li>es werden alle Daten aller Tabellen einer ginstr app heruntergeladen: in diesem Fall werden die Daten in einer .zip Datei zusammengefasst und dann heruntergeladen.\n </li>\n</ul>\n</li>\n</ul>\n</li>\n<br>\n<li>Filter für Zeilen:<br>\nginstr web bietet eine Vielzahl von Möglichkeiten um Tabelleninhalte zu filtern und zu sortieren. Weiterführende Informationen finden sich im ginstr web Handbuch (http://wiki.ginstr.com/index.php/ginstr_web) sowie im Hilfetext bei jeder Tabelle. Diese Option erlaubt festzulegen, ob unabhängig vom aktuellen Bildschirminhalt alle Zeilen der herunterzuladenden Tabellen heruntergeladen werden sollen oder nur die angezeigten Zeilen:\n<ul>\n<br>\n<li>Alle Zeilen:\n<br>mit dieser Option lassen sich alle Datensätze der herunterzuladenden Tabellen herunterladen unabhängig von den aktuell angewandten Filterkriterien\n</li>\n<br>\n<li>Sichtbare Zeilen:\n<br>mit dieser Option lassen sich die sichtbaren Datensätze der herunterzuladenden Tabellen herunterladen abhängig von den aktuell angewandten Filterkriterien\n</li>\n<br>\n<li>Abhängige Tabellen:\n<br>wird diese Option gewählt, so werden alle abhängigen Tabellen heruntergeladen, d.h. alle Tabellen derselben ginstr app bzw. alle Tabellen mit Querverweisen auf die gewählte Tabelle bei selbstdefinierten Tabellen.\n</li>\n</ul>\n</li>\n<br>\n<li>Filter für Spalten:<br>\nginstr web bietet die Möglichkeit, Spalten von Tabellen ein- oder auszublenden. Weiterführende Informationen finden sich im <a href=\"http://wiki.ginstr.com/index.php/ginstr_web\" target=\"_blank\">ginstr web Handbuch</a> sowie im Hilfetext bei jeder Tabelle. Diese Option erlaubt festzulegen, ob unabhängig vom aktuellen Bildschirminhalt alle Spalten der herunterzuladenden Tabellen heruntergeladen werden sollen oder nur die angezeigten Spalten:\n<ul>\n<br>\n<li>Alle Spalten:\n<br>mit dieser Option lassen sich die Daten in allen Spalten der herunterzuladenden Tabellen herunterladen unabhängig von den aktuell angewandten Einstellungen für die Sichtbarkeit der Tabellenspalten\n</li>\n<br>\n<li>Sichtbare Spalten:\n<br>mit dieser Option lassen sich die sichtbaren Spalten der herunterzuladenden Tabellen herunterladen abhängig von den aktuell angewandten Einstellungen für die Sichtbarkeit der Tabellenspalten\n</li>\n</ul>\n</li>\n</ul>",
