    "detailsPortlet.helpTip.content": "<h3>Datensatz editieren</h3>\nIn diesem Portlet können die Daten eines einzelnen Datensatzes einer beliebigen Tabelle komfortabel editiert werden.<br/>\n\nDazu bitte zunächst auf einen beliebigen Datensatz einer beliebigen Tabelle im selben Arbeitsbereich klicken. Nun werden die Daten des Datensatzes in diesem Portlet angezeigt.<br/>\n<br/>\nZum Ändern der Daten bitte mit einem Doppelklick auf die zu ändernden Daten klicken. Nun lassen sich die Daten beliebig editieren.<br/>\n<br/>\nGeänderte Daten werden automatisch gespeichert sobald eines der folgenden Ereignisse eintritt:<br/>\n<ul> \n<li>es wird ein anderer Datensatz einer Tabelle angeklickt</li>\n<li>es wird ein anderes Portlet aktiviert</li>\n<li>es wird ein anderer Arbeitsbereich aktiviert</li>\n<li>der Portlet-Inhalt wird entfernt</li>\n<li>der Benutzer kehrt zurück zur Lobby</li>\n</ul> \n<br/>\nAm oberen Rand dieses Portlets gibt es eine Schaltfläche, mit der sich dieses Portlet fest einer Tabelle im selben Arbeitsbereich zuordnen lässt. Ist diese Funktion aktiviert, so werden keine Daten einer anderen Tabelle in diesem Portlet angezeigt selbst dann, wenn der Benutzer auf einen Datensatz einer anderen Tabelle klickt.<br/>\n<br/>\nFalls in einem Arbeitsbereich mehrere Portlets zum Editieren von Datensätzen eingerichtet sind kann jedem dieser Portlets eine andere Tabelle zum Editieren von Daten zugeordnet werden.",
