    "agGrid.import.dialog.help2": "<p>Wenn in der hochzuladenden Datei die Spalte &ldquo;Der Datensatz wurde erstellt am&ldquo; leer ist, dann bekommen die neu hochgeladenen Datensätze ein Erstellungsdatum mit dem Zeitstempel des Moments, in dem Daten hochgeladen wurden. Andernfalls wird das Erstellungsdatum verwendet, das in der hochzuladenden Datei gespeichert ist.</p>\n<p>Dateinamen und Tabellennamen:</p>\n<ul>\n<li>Excel-Dateien: Für den Upload von Excel Dateien sind die Excel Dateinamen und der Name der Tabelle nicht relevant. Jede Excel Tabelle muss aber in der Zelle A1 den exakten Namen der Tabelle haben, in welche die Daten hochgeladen werden. Dieser Tabellenname muss übereinstimmen mit der Sprache, die unter „Sprache“ im „Daten hochladen“ Popup Fenster ausgewählt wurde.</li>\n<li>.CSV-Dateien: csv Dateinamen müssen folgendes Format haben: &lt;Tabellenname in der Sprache vom Import&gt; + &ldquo;.csv&ldquo; Beispiel: Kunden.csv </li>\n</ul>\n",
    "error.8023": "Ungültiger Wert für diese Einstellung: %s",
    "agGrid.import.dialog.help3": "<p>Daten mit einem Bezug zu anderen Tabellen in der ginstr cloud (die nicht in der Excel Datei vorhanden sind) können nur hochgeladen werden, wenn für die entsprechenden Spalten der Bezug „einzigartiges“ Attribut eingestellt wurde. Wenn beim Excel-Import beide Spalten vorhanden sind (die Spalte zu der ein Bezug geschaffen wird und die Spalte, die einen Bezug hat), so kann der Import zu einer „nicht-einzigartigen“ Reihe erfolgen, wenn der Bezug ein korrekter Excel Bezug ist.</p>\n<p>Bitte beachten Sie, dass die Daten-Upload Funktion Datensätze nicht aktualisiert - sie erstellt nur neue Datensätze.</p>\n<p>Beim Hochladen von Excel .xlsx Dateien muss folgendes beim Excel-Zelltyp beachtet werden: in den Spalten muss das Datum- und Zahlenformat dem vorher im „Daten hochladen“ Popup Fenster gewählte Format entsprechen. Wenn Datum und Zahlen in einer Excel Datei als ein Zahlen-Datentyp gespeichert sind, so wird dieses Excel Format während des Daten-Uploads genutzt. In diesem Fall wird das im „Daten-Upload“ Popup Fenster gewählte Format ignoriert.</p>\n<p>Das Daten-Upload Limit ist max. 100 MB pro hochzuladener Datei.</p>\n",
    "error.8022": "Der angegebene Name für diese Einstellung wird bereits verwendet",
    "deviceGrid.col.name": "Name des Trackables",
    "error.8021": "Es fehlt der Name für diesen Wert",
    "agGrid.import.dialog.help1": "<ul>\n<li>Sprache: die meisten ginstr apps sind in mehreren Sprachen verfügbar. Die Sprachauswahl beeinflusst nicht nur die Benutzeroberfläche der Anwendungen auf dem Handy, sondern auch die Spaltenüberschriften der Tabellen in ginstr web. Mit dieser Option kann die Sprache ausgewählt werden, in der die Spaltenüberschriften in der hochzuladenden CSV-oder .Excel Datei erstellt wurden. Dies ist wichtig, um sicherzustellen, dass die Upload-Routine den Inhalt der verschiedenen Spalten in den Dateien den entsprechenden Spalten der ginstr Tabellen korrekt zuordnen kann. Der Standardwert ist abhängig von den Einstellungen des jeweiligen Benutzers in seinem ginstr web Benutzerkonto.</li>\n<li>Zeit Format: ginstr unterstützt mehrere Zeitformate. Mit dieser Option wird festgelegt, welches Zeitformat in der hochzuladenden Datei verwendet wurde. Dies ist wichtig, um sicherzustellen, dass die Upload-Routine die Zeitstempel in den verschiedenen Spalten korrekt behandelt. Beispiele für Zeitformate: &ldquo;10:00:00 PM&ldquo; oder &ldquo;22:00:00&ldquo. Der Standardwert ist abhängig von den Einstellungen des jeweiligen Benutzers in seinem ginstr web Benutzerkonto.</li>\n<li>Datumsformat: ginstr unterstützt mehrere Datumsformate . Mit dieser Option wird festgelegt, welches Datumsformat in der hochzuladenden Datei verwendet wurde. Dies ist wichtig, um sicherzustellen, dass die Upload-Routine die Datumsangaben in den verschiedenen Spalten korrekt behandelt. Der Standardwert ist abhängig von den Einstellungen des jeweiligen Benutzers in seinem ginstr web Benutzerkonto.</li>\n<li>Zahlenformat: ginstr unterstützt mehrere Zahlenformate . Mit dieser Option wird festgelegt, welches Zahlenformat in der hochzuladenden Datei verwendet wurde. Dies ist wichtig, um sicherzustellen, dass die Upload-Routine, die Zahlen in den verschiedenen Spalten korrekt behandelt. Der Standardwert ist abhängig von den Einstellungen des jeweiligen Benutzers in seinem ginstr web Benutzerkonto.</li>\n<li>Zeitzone: ginstr speichert intern alle Daten in der UTC-Zeitzone; dies ist die universelle, weltweit gleiche Zeit. Bevor Datum und Uhrzeit auf dem Bildschirm angezeigt werden, wird jeder Zeitstempel auf die in den ginstr web Einstellungen definierte Zeitzone umgerechnet. Mit dieser Option wird festgelegt, welche Zeitzone in der hochzuladenden Datei verwendet wurde. Der Standardwert ist abhängig von den Einstellungen des jeweiligen Benutzers in seinem ginstr web Benutzerkonto.\n</li>\n<li>Datei auswählen: Mit dieser Option kann die Datei auf dem lokalen Laufwerk ausgewählt werden, welche die Daten enthält, die in die ginstr cloud hochgeladen werden sollen.</li>\n</ul>\n",
