    "GENERIC_NO": "Nein",
    "map.helpTip.content2": "<ul>\n<li>\"Geofence bearbeiten\" kann durch Klicken auf das \"Hand\" -Symbol aufgerufen werden.<br /> Die Aktion \"Geofence bearbeiten\" kann beendet werden, indem Sie auf eine beliebige Stelle au&szlig;erhalb des Geofence klicken.<br /> Nach dem Klicken auf \"Bearbeiten\" wird jede Ecke des Geofence mit einem wei&szlig;en Feld angezeigt.<br /> Durch Klicken und Ziehen einer solchen Box &uuml;ber die Karte k&ouml;nnen Sie die Positionen der Scheitelpunkte des Geofence bearbeiten.<br /> Wenn dieser Geofence mehr als drei Scheitelpunkte aufweist, wird durch Klicken auf eine Scheitelpunkt-Box dieser Scheitelpunkt entfernt.<br /> Innerhalb der wei&szlig;en Boxen erscheint eine \"transparente\" Box, die angeklickt und verschoben werden kann, um neue Scheitelpunkte im Geofence zu erstellen.<br /> Ung&uuml;ltige Geofence-Formen werden w&auml;hrend der Bearbeitung durch eine rosa Farbe gekennzeichnet.<br /> Ein Dreieck ist der einfachste Geofence, den Sie zeichnen k&ouml;nnen.</li>\n</ul>\n<ul>\n<li>\"Geofence l&ouml;schen\" kann durch Klicken auf das \"M&uuml;lleimer\" -Symbol ausgef&uuml;hrt werden.</li>\n</ul>\n<p><strong>Dropdown-Men&uuml;aktionen:</strong><br /><br /> Wenn Sie &uuml;ber dem \"Planeten\" -Symbol in der oberen linken Ecke des Karten-Widget fahren, &ouml;ffnet sich ein Dropdown-Men&uuml; mit folgenden Optionen:</p>\n<ul>\n<li>Geofences:<br /> Geofences ein- / ausblenden</li>\n</ul>\n<ul>\n<li>OpenSeaMap:<br /> zeigt / versteckt die OpenSeaMap-Kartenebene, die maritime Informationen (Bojen, Leuchtt&uuml;rme usw.) bereitstellt</li>\n</ul>\n<ul>\n<li>Suche:<br /> zeigt / versteckt dauerhaft ein Eingabefeld, in dem Sie wie folgt nach einer Adresse suchen k&ouml;nnen:\n<ul>",
    "map.helpTip.content1": "<ul>\n<li>Pfeile in der oberen linken Ecke des Kartenportlets:<br /> f&uuml;hrt die gleichen Bewegungen aus, aber in gro&szlig;en Schritten</li>\n</ul>\n<p>Sie haben folgende Optionen, um die Karte zu vergr&ouml;&szlig;ern:</p>\n<ul>\n<li>Scrollen mit dem Mausrad:<br /> zoomt die Karte rein oder raus</li>\n</ul>\n<ul>\n<li>\"Plus\" - und \"Minus\" -Schaltfl&auml;chen in der oberen linken Ecke des Karten-Portlets:<br /> zoomt die Karte rein oder raus</li>\n</ul>\n<ul>\n<li>Klicken Sie auf den Zoom-Schieberegler am linken Rand des Karten-Portlets:<br /> zoomt die Karte auf die ausgew&auml;hlte Zoomstufe</li>\n</ul>\n<p><strong>Aktionen mit Pushpins:</strong><br /><br /> Jeder Pushpin hat ein &ldquo;Popup&rdquo;, das alle im zugeh&ouml;rigen Datensatz gespeicherten Daten anzeigt.<br /> Sie k&ouml;nnen diese Daten sehen, indem Sie mit der Maus &uuml;ber den Pushpin fahren.<br /> Wenn Sie auf einen Pushpin klicken bleibt das Popup ge&ouml;ffnet, bis Sie es schlie&szlig;en, indem Sie entweder auf das \"x\" in der oberen rechten Ecke des Popups klicken oder irgendwo auf der Karte klicken.<br /><br /><strong><br /> Aktionen mit Geofences:</strong><br /><br /> Jeder Geofence bietet ein Popup mit Aktionen.<br /> Sie k&ouml;nnen dieses Popup sehen, indem Sie irgendwo auf einen Geofence klicken.<br /><br /> Die folgenden Aktionen sind f&uuml;r Geofences verf&uuml;gbar:</p>",
