    "map.helpTip.content4": "<ul>\n<li>Inhalt anzeigen / ausblenden:<br /> &ouml;ffnet ein Untermen&uuml; mit folgenden Optionen\n<ul>\n<li>Geofences:<br /> Geofences ein- / ausblenden</li>\n<li>OpenSeaMap:<br /> zeigt / versteckt die OpenSeaMap-Kartenebene, die maritime Informationen (Bojen, Leuchtt&uuml;rme usw.) anzeigt</li>\n<li>Suche:<br /> zeigt / versteckt dauerhaft ein Eingabefeld, in dem Sie wie folgt nach einer Adresse suchen k&ouml;nnen:\n<ul>\n<li>Sie k&ouml;nnen eine Adresse oder einen Teil einer Adresse in das Adressfeld eingeben.<br /> Eine Liste der Ergebnisse wird automatisch angezeigt. Sie m&uuml;ssen nicht die \"Enter\"-taste dr&uuml;cken um die Ergebnisse zu sehen. <br /> Sie k&ouml;nnen eine beliebige Adresse aus dieser Trefferliste ausw&auml;hlen, indem Sie darauf klicken.</li>\n<li>Sobald Sie auf eine Adresse klicken, wird die Karte auf diese Position verschoben, ohne die Zoomstufe zu &auml;ndern, und ein Pushpin wird an der ausgew&auml;hlten Adresse angezeigt.</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>",
