    "map.helpTip.content3": "<li>Sie k&ouml;nnen eine Adresse oder einen Teil einer Adresse in das Adressfeld eingeben.<br /> Eine Liste der Ergebnisse wird automatisch angezeigt. Sie m&uuml;ssen nicht die \"Enter\"-taste dr&uuml;cken um die Ergebnisse zu sehen. <br /> Sie k&ouml;nnen eine beliebige Adresse aus dieser Trefferliste ausw&auml;hlen, indem Sie darauf klicken.</li>\n<li>Sobald Sie auf eine Adresse klicken, wird die Karte auf diese Position verschoben, ohne die Zoomstufe zu &auml;ndern, und ein Pushpin wird an der ausgew&auml;hlten Adresse angezeigt.</li>\n</ul>\n</li>\n</ul>\n<p><strong>Rechte Mausklick-Optionen:</strong></p>\n<p>Wenn Sie mit der rechten Maustaste irgendwo innerhalb der Karte klicken, &ouml;ffnet sich ein Kontextmen&uuml; mit folgenden Optionen:</p>\n<ul>\n<li>Geofence hinzuf&uuml;gen:<br /> Erm&ouml;glicht das Zeichnen eines neuen Geofence.<br /> Das Beenden Ihres Geofence kann wie folgt abgeschlossen werden:<br /> - Indem Sie auf den Startpunkt des Polygons klicken, oder<br /> - Doppelklicken Sie irgendwo auf der Karte.</li>\n</ul>",
