    "sso.application.constructionEquipmentHire": "Baumaschinenvermietung",
    "calendarPortlet.helpTip.content4": "<p>Spalten mit allen sonstigen Datentypen k&ouml;nnen verwendet werden.</p>\n<p>&nbsp;</p>\n<h3>Zu viele Ereignisse f&uuml;r die Anzeige:</h3>\n<p>F&uuml;r den Fall dass die Anzeige der ausgew&auml;hlten Ereignisse mehr Platz ben&ouml;tigt als im Kalender verf&uuml;gbar, wird wie folgt verfahren:</p>\n<ul>\n<li>Monatsansicht:<br /> wenn der erforderliche Platz f&uuml;r die Anzeige der Ereignisse gr&ouml;&szlig;er ist als der verf&uuml;gbare Platz beim jeweiligen Tag, dann werden die nicht anzeigbaren Ereignisse, durch einen Link &bdquo;+n mehr&ldquo; ersetzt. Dabei ist &bdquo;n&ldquo; die Anzahl der aktuell nicht angezeigten Ereignisse am jeweiligen Tag.<br /> Der Benutzer kann sich die aktuell nicht angezeigten Ereignisse durch einen Klick auf den Link anzeigen lassen.</li>\n<li>Alle Ansichten:<br /> jedes Ereignis hat einen Link zur Anzeige alle Daten; diese Daten k&ouml;nnen angezeigt werden indem man die Maus &uuml;ber den Link bewegt.</li>\n</ul>",
    "error.4010": "Die benannte Position wurde deaktiviert",
    "aggrid.document.hover.filename": "Dateiname:",
    "calendarPortlet.endField.label": "End Spalte",
    "calendarPortlet.helpTip.content3": "<h3>Konfiguration der pro Ereignis anzuzeigenden Information:</h3>\n<p>Klickt man auf die Schaltfl&auml;che mit den drei waagerechten Linien in der rechten oberen Ecke des Bildschirms k&ouml;nnen folgende Einstellungen vorgenommen werden:</p>\n<ul>\n<li>Spalten, deren Inhalt pro Ereignis angezeigt werden soll:<br /> mit dieser Option k&ouml;nnen die Spalten einer ginstr Tabelle ausgew&auml;hlt werden, deren Inhalt f&uuml;r jedes Ereignis angezeigt werden soll; es kann eine oder es k&ouml;nnen mehrere Spalten ausgew&auml;hlt werden. Die Optionen im Dropdown-Men&uuml; werden in der gleichen Reihenfolge wie die dazugeh&ouml;rigen Spalten in der Tabelle angezeigt. <br /> Spalten mit einem der folgenden Datentypen k&ouml;nnen nicht ausgew&auml;hlt werden:\n<ul>\n<li>&bdquo;Datum&ldquo;</li>\n<li>&bdquo;Uhrzeit&ldquo;</li>\n<li>&bdquo;Datum &amp; Uhrzeit&ldquo;</li>\n<li>&bdquo;Zeitdauer&ldquo;</li>\n<li>&bdquo;Audio&ldquo;</li>\n<li>Dokumente</li>\n<li>&bdquo;Datumliste&ldquo;</li>\n<li>&bdquo;Datum- und Uhrzeitliste&ldquo;</li>\n<li>&bdquo;Uhrzeitliste&ldquo;</li>\n<li>&bdquo;Bild&ldquo;</li>\n<li>&bdquo;Unterschrift&ldquo;</li>\n<li>&bdquo;Video&ldquo;</li>\n</ul>\n</li>\n</ul>",
