    "ag.table.data.type.document.invalid.filetoolarge": "Dieses Dokument ist zu groß. Maximal erlaubte Dateigröße: {maxSize}",
    "autoreport.table.dialog.testReportToAll.label": "Bericht an alle senden",
    "calendarPortlet.helpTip.content2": "<li>Die linkeste Spalte (Datum-1) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo;.<br /> Die n&auml;chste weiter rechts liegende Spalte (Datum-2) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum&ldquo;.<br /> Die wiederum n&auml;chste weiter rechts liegende Spalte (Datum-3) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo;: in diesem Fall wird das Ereignis zwischen Datum-1 und Datum-3 liegen</li>\n<li>Die linkeste Spalte (Datum-1) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; und den Wert 24. Dezember 2017 10:20:30<br /> Die n&auml;chste weiter rechts liegende Spalte (Datum-2) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; und den Wert 24. Dezember 2017 22:33:44<br /> Die wiederum n&auml;chste weiter rechts liegende Spalte (Datum-3) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum&ldquo;.<br /> in diesem Fall wird das Ereignis am Tag Datum-1 angezeigt mit der Dauer von 10:20:30 Uhr bis 22:33:44 Uhr.</li>\n<li>Die linkeste Spalte mit dem Datentyp 'Datum' oder 'Datum und Uhrzeit' (Datum-1) hat den Datentyp 'Datum &amp; Uhrzeit'. Die n&auml;chste Spalte rechts mit 'Datum' oder 'Datum &amp; Uhrzeit' Datentyp (Datum-2) hat Datentyp 'Datum'. Die n&auml;chste Spalte rechts mit 'Datum' oder 'Datum &amp; Uhrzeit' Datentyp (Datum-3) hat den Datentyp 'Datum'. In diesem Fall wird das Ereignis auf Datum-1 gesetzt.</li>\n</ul>\n<p>&nbsp;</p>\n<h3>Abh&auml;ngigkeiten zwischen der ginstr Tabelle und der Kalenderanzeige:</h3>\n<p>Anklicken eines einzelnen Datensatzes in der ginstr Tabelle:<br /> Das in diesem Datensatz enthaltene Ereignis wird angezeigt.</p>\n<p>Anklicken von mehreren Datens&auml;tzen (mit STRG oder SHIFT Taste):<br /> werden mehrere Datens&auml;tze mit Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; ausgew&auml;hlt, die zusammen einen Zeitraum &uuml;berdecken, der gr&ouml;&szlig;er ist als der Zeitraum der aktuell gew&auml;hlten Ansicht (z.B. mehrere Monate im Vergleich zu einer Arbeitswoche, die aktuell angezeigt wird), so wird zun&auml;chst das zeitliche Ende des insgesamt &uuml;berdeckten Zeitraums angezeigt.</p>\n<p>Werden vom Benutzer Datens&auml;tze in einer Tabelle ausgew&auml;hlt, die weder Spalten mit dem Datentyp &bdquo;Datum&ldquo; noch Spalten mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; enth&auml;lt, so werden im Kalender-Bereich keine Ereignisse angezeigt.</p>\n<p>&nbsp;</p>",
    "calendarPortlet.helpTip.content1": "<p>&nbsp;</p>\n<p>Abh&auml;ngig von der Reihenfolge der Spalten mit dem Datentyp &bdquo;Datum&ldquo; bzw. mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; werden Ereignisse unterschiedlich dargestellt. Diese Reihenfolge kann mit den drag&amp;drop Spalten&uuml;berschriften ver&auml;ndert werden</p>\n<p>&nbsp;</p>\n<p>Beispiele:</p>\n<ul>\n<li>1 Spalte mit dem Datentyp &bdquo;Datum&ldquo; und dem Wert 24. Dezember 2017:<br /> in diesem Fall dauert das Ereignis vom 24. Dezember 2017 00:00:00 Uhr bis 24. Dezember 2017 23:59:59</li>\n<li>1 Spalte mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; und dem Wert 24. Dezember 2017 10:20:30 Uhr: <br /> In diesem Fall hat das Ereignis keine Dauer, der Wert der verwendet wird setzt sich aus der Uhrzeit und dem Ereignis was am wenigsten Text (eine Zeile) f&uuml;r &bdquo;Woche, Tag, Arbeitswoche&ldquo; beansprucht. F&uuml;r die Monats&uuml;bersicht dauert das Ereignis vom 24. Dezember 2017 00:00:00 Uhr bis 24. Dezember 2017 23:59:59 &ndash; die Uhrzeit wird in diesem Fall nicht ausgewertet</li>\n<li>2 Spalten mit dem Datentyp &bdquo;Datum&ldquo; und den Werten 24. Dezember 2017 und 26. Dezember 2017:<br /> in diesem Fall dauert das Ereignis vom 24. Dezember 2017 00:00:00 Uhr bis 26. Dezember 2017 23:59:59</li>\n<li>2 Spalten mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; und den Werten 24. Dezember 2017 10:20:30 und 26. Dezember 2017 22:33:44:<br /> in diesem Fall dauert das Ereignis vom 24. Dezember 2017 10:20:30 Uhr bis 26. Dezember 2017 22:33:44</li>\n</ul>\n<p>Liegt das Datum oder der Zeitpunkt der linken Spalte sp&auml;ter als Datum oder Zeitpunkt der rechten Spalte so werden die beiden Spalten getauscht.</p>\n<p>Wenn es sowohl Spalten mit dem Datentyp &bdquo;Datum&ldquo; als auch Spalten mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; gibt, so entscheidet der Datentyp der linkesten Spalte dar&uuml;ber, ob Ereignisse mit dem Datentyp &bdquo;Datum&ldquo; oder Ereignisse mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; angezeigt werden.</p>\n<p>Beispiele:</p>\n<ul>\n<li>Die linkeste Spalte (Datum-1) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum&ldquo;.<br /> Die n&auml;chste weiter rechts liegende Spalte (Datum-2) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat ebenfalls den Datentyp &bdquo;Datum&ldquo;.<br /> Die wiederum n&auml;chste weiter rechts liegende Spalte (Datum-3) mit entweder Datentyp &bdquo;Datum&ldquo; oder Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; hat den Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo;.<br /> in diesem Fall wird das Ereignis zwischen Datum-1 und Datum-2 angezeigt.</li>",
