    "agtotal.setup.ungroupedlist.column": "Spalte",
    "ag.table.date.defaultFilter.currentMonth": "Aktueller Monat",
    "calendarPortlet.helpTip.content": "<p>In diesem Kalender-Bereich werden Datumseintr&auml;ge von aktuell ausgew&auml;hlten Datens&auml;tzen der aktuell ausgew&auml;hlten ginstr Tabelle angezeigt sofern diese eine oder mehrere Spalten mit dem Datenformat &ldquo;Datum&rdquo; und/oder eine oder mehrere Spalten mit dem Datenformat &ldquo;Datum &amp; Uhrzeit&rdquo; hat.</p>\n<p>Ist eine Tabelle mit dem Kalender-Bereich fest verkn&uuml;pft, so werden die Daten dieser fest verkn&uuml;pften Tabelle angezeigt.</p>\n<p>Eine Spalte mit dem Datentyp &bdquo;Datum&ldquo; beschreibt einen konkreten Tag, z.B. 24. Dezember 2017</p>\n<p>Eine Spalte mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; speichert zus&auml;tzlich zum Datum noch eine Zeitinformation in Stunden-Minuten-Sekunden, z.B. 24. Dezember 2017 23:48:59 Uhr.</p>\n<p>&nbsp;</p>\n<h3>Ereignisse:</h3>\n<p>Jeder in der ginstr Tabelle ausgew&auml;hlte Datensatz wird als &bdquo;Ereignis&ldquo; in diesem Kalender-Bereich angezeigt. Jedes Ereignis hat einen Startzeitpunkt und einen Endzeitpunkt (eine Dauer)</p>\n<h3>Folgende Schaltfl&auml;chen gibt es im Kalender-Bereich:</h3>\n<li>Monat:<br /> zeigt Ereignisse im ausgew&auml;hlten Monat</li>\n<li>Woche:<br /> zeigt Ereignisse in der ausgew&auml;hlten Woche</li>\n<li>Tag:<br /> zeigt Ereignisse am ausgew&auml;hlten Tag</li>\n<li>Arbeitswoche:<br /> zeigt Ereignisse in der ausgew&auml;hlten Arbeitswoche<br /> (der erste Tag der Arbeitswoche kann in den Einstellungen in der rechten oberen Ecke des Bildschirms festgelegt werden (Sonntag oder Montag)</li>\n<li>Heute:<br /> zeigt die Ereignisse am heutigen Tag an</li>\n<li>Zur&uuml;ck<br /> hiermit kann ein fr&uuml;herer Zeitraum angezeigt werden (Tag, Woche, Arbeitswoche oder Monat, je nachdem welcher Zeitraum gerade ausgew&auml;hlt ist)</li>\n<li>Weiter:<br /> hiermit kann ein sp&auml;terer Zeitraum angezeigt werden (Tag, Woche, Arbeitswoche oder Monat, je nachdem welcher Zeitraum gerade ausgew&auml;hlt ist)</li>\n<li>Dieses Portlet fest mit der aktuellen Tabelle verkn&uuml;pfen<br /> ist diese Schaltfl&auml;che aktiviert, so werden keine Daten einer anderen Tabelle angezeigt, selbst dann, wenn der Benutzer auf einen Datensatz einer anderen Tabelle klickt.</li>\n</ul>\n<p><strong>&nbsp;</strong></p>\n<h3>Darstellung von Ereignissen</h3>\n<ul>\n<li>Monatsansicht:<br /> Ereignisse werden anhand von deren Anfangs- und Enddatum angezeigt.<br /> Die Uhrzeit-Information wird nicht verwendet.</li>\n</ul>\n<p>Die Monatsansicht kann in zwei unterschiedlichen Varianten angezeigt werden:</p>\n<ul>\n<li>Ereignisse mit dem Datentyp &bdquo;Datum&ldquo;:<br /> es wird ein gef&uuml;lltes Feld angezeigt mit der dem jeweiligen Datensatz zugewiesenen Farbe; wurde dem Datensatz noch keine Farbe zugewiesen so wird das ginstr-blau verwendet.</li>\n<li>Ereignisse mit dem Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo;:<br /> es wird eine Linie und ein Punkt mit der Farbe angezeigt, die dem Datensatz zugewiesen ist.</li>\n</ul>\n<p>&nbsp;</p>\n<ul>\n<li>Wochenansicht, Tagesansicht, Ansicht einer Arbeitswoche:\n<ul>\n<li>Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo;:<br /> Ereignisse werden samt Anfangszeit und Endezeit angezeigt.</li>\n<li>Datentyp &bdquo;Datum&ldquo;:<br /> Ereignisse werden in der Zeile &bdquo;Ganzer Tag&ldquo; im Kalender-Bereich angezeigt</li>\n<li>Datentyp &bdquo;Datum &amp; Uhrzeit&ldquo; mit nur einer Spalte:<br /> Ereignisse werden nach &bdquo;Datum &amp; Uhrzeit&ldquo; mit Mindestgr&ouml;&szlig;e (eine Textzeile) angezeigt</li>\n<li>Ereignisse die eine Dauer von mehr als ein Tag haben, werden im Bereich &bdquo;Ganzer Tag&ldquo; angezeigt</li>\n</ul>\n</li>\n</ul>",
    "autoreport.variable.reportType": "$Berichtstyp",
