    "ag-table.helpTip.content2": "<h3>Auswählen von Datensätzen</h3>\nKlickt man auf einen beliebigen Datensatz in einer beliebigen Tabelle so wird dieser Datensatz blau markiert. Damit wird angezeigt, daß dieser Datensatz 'ausgewählt' wurde.<br>\nKlickt man auf einen beliebigen Datensatz einer Tabelle und dann mit UMSCHALT-KLICK auf einen anderen Datensatz derselben Tabelle so werden alle Datensätze zwischen den beiden angeklickten Datensätzen samt den beiden angeklickten Datensätzen ausgewählt und blau markiert.<br>\nKlickt man auf einen beliebigen Datensatz einer Tabelle und dann mit STRG-KLICK auf einen anderen Datensatz derselben Tabelle so wird der mit STRG-CLICK angeklickte Datensatz zur Liste der ausgewählten Datensätze hinzugefügt und blau markiert. Mit STRG-KLICK können beliebig viele Datensätze einzeln nacheinander der Auswahl hinzugefügt werden.<br>\n<br>\nDas Auswählen von einem oder mehreren Datensätzen ist vielfältig hilfreich.<br>\n<br>\nHier einige Beispiele:\n<ul>\n<li>Enthalten die ausgewählten Datensätze eine Spalte mit GPS-Koordinaten und ist im selben Arbeitsbereich ein Portlet mit Landkarte aktiviert, so werden die GPS-Koordinaten der <u>ausgewählten</u> Datensätze in Form von Pushpins auf der Landkarte angezeigt.</li>\n<br>\n<li>Wird nach dem Auswählen von einem oder von mehreren Datensätzen die ENTF Taste auf der Tastatur gedrückt, so werden alle ausgewählten Datensätze nach dem Bestätigen einer Sicherheitsabfrage gelöscht. Dieser Vorgang kann NICHT rückgängig gemacht werden.</li>\n<br>\n<li>Wird nach dem Auswählen von mehreren Datensätzen ein Farbe zugeordnet so erfolgt diese Farbzuordnung zu allen ausgewählten Datensätzen. So lassen sich Farben zu mehreren Datensätzen viel schneller zuordnen als es bei einer Zuordnung zu einzelnen Datensätzen nacheinander möglich wäre.</li><br>\n<li>Wird ein einzelner Datensatz ausgewählt und ist in einem weiteren Portlet desselben Arbeitsbereichs der Inhalt 'Datensatz editieren' aktiviert, so werden alle Daten des selektierten Datensatzes im Portlet 'Datensatz editieren' zum Editieren angeboten.</li>\n<br>\n<li>Werden mit UMSCHALT-KLICK und/oder STRG-KLICK mehrere Datensätze ausgewählt, so wird über der Tabelle eine zusätzliche Schaltfläche 'Aktionen' eingeblendet. Diese Schaltfläche bietet nach dem Anklicken folgende Optionen:<br>\n- Löschen von allen ausgewählten Datensätzen<br>\n- Zuordnung einer Farbe zu allen ausgewählten Datensätzen</li>\n<br>\n<li>Werden in einer Tabelle A, auf die eine Spalte mit dem \"Zeiger\" Datentyp einer anderen Tabelle B zeigt, einer oder mehrere Datensätze ausgewählt, so werden in Tabelle B nur noch Datensätze angezeigt, die auf den oder die in Tabelle A ausgewählten Datensätze zeigen.<br>\nDies gilt nur, sofern die Option 'Tabelle anhand der Auswahl in der Tabelle filtern, auf die verwiesen wird' für die Spalte mit dem Datentyp \"Zeiger\" in Tabelle B aktiviert ist.</li>\n</ul>",
    "sso.application.relocationConsulting": "Umzug Bestandsaufnahme",
    "geofence.leave.alarm.email.subject": "[{date}] EIN GEOFENCE WURDE VERLASSEN: Trackable={device} / Geofence={geofence}",
    "date.pattern._full": "EEEE dd, MMMM yyyy",
    "ag-table.helpTip.content1": "<h3>SORTIEREN von Tabellen (Klick auf die Tabellenüberschrift)</h3> \nKlicken auf die Spaltenüberschriften startet das Sortieren (oder Mehrfach Sortieren) wie folgt: \n<ul> \n<li>Klickt man auf die Überschrift einer Spalte, die nicht sortiert ist, wird die Spalte aufsteigend sortiert.</li> \n<li>Klickt man auf die Überschrift einer Spalte, die bereits sortiert ist, dann bewirkt jeder Klick die jeweils andere Sortierreihenfolge (aufsteigend =&gt; absteigend // absteigend =&gt; aufsteigend)</li> \n<li>Klickt man auf die Überschrift einer bereits sortierten Spalte mit STRG Klick wird die Sortierung entfernt (das Dreiecksicon verschwindet). Dies hat keinen Einfluss auf die Zeilenreihenfolge, wenn nur diese eine Spalte sortiert war, aber es beeinflusst die Sortierung im Fall, dass mehrere Spalten sortiert sind.</li>\n</ul> \n<ul> \n<li>STRG Klick auf mehrere Spaltenüberschriften aktiviert die Sortierung nach allen diesen Spalten (das Dreiecksicon erscheint in jeder der Spalten) Die Priorität der Sortierung hängt ab von der Reihenfolge, in der die Spalten angeklickt wurden um sie zur Sortierauswahl hinzuzufügen.</li>\n<li>Ist nach mehreren Spalten sortiert und klickt man mit gedrückter STRG Taste auf eine Spalte, die zu den Spalten der Sortierauswahl gehört, so wird in dieser Spalte die Sortierreihenfolge umgekehrt.</li> \n<li>Ist das multiple Sortieren angewendet und klickt man in eine Spaltenüberschrift ohne die STRG Taste zu drücken, wird das multiple Sortieren komplett entfernt und man aktiviert die Sortierung ausschließlich nach dieser Spalte</li>\n</ul> \n\n<h3>SUCHEN in Tabellen (Klick in Tabellenfelder)</h3>\n<ul> \n<li>Klickt man in eine Zelle einer Tabelle wählt man die Zeile aus (sie wird farblich gekennzeichnet). Gleichzeitig fügt man die Spalte der Suchauswahl zu. Die Spaltenüberschrift wird dunkelblau. Dies bedeutet dass, sobald zumindest eine Spalte eine dunkelblaue Überschrift hat, der Suchstring, den man im linken oberen Feld eingibt sich ausschließlich auf die Spalte(n) mit den dunkelblauen Überschriften bezieht.</li> \n<li>STRG+Klick in irgendeine Zelle einer anderen Spalte fügt diese Spalte der Suchauswahl hinzu; Klickt der Benutzer in eine andere Zeile als zuvor, wird diese Zeile ebenso als ausgewählt markiert.</li>\n<li>STRG+Klick in die gleiche Spalte, die bereits der Suchauswahl hinzugefügt wurde, entfernt die Spalte von der Suchauswahl; Ist die angeklickte Zelle in der gleichen Zeile, die zuvor bereits ausgewählt wurde, ist diese Zeile nun nicht mehr ausgewählt.</li>\n<li>Ein Klick in eine Zelle und dann ein SHIFT+Klick in eine andere Zelle in einer rechts oder links gelegenen Spalte fügt alle Spalten zwischen den beiden angeklickten Spalten inklusive der angeklickten Spalten zur Suchauswahl hinzu; die Spaltenüberschriften werden dunkelblau markiert; Ist die Zelle, die mit SHIFT+Klick angeklickt wurde in einer bislang nicht ausgewählten Zeile, dann sind alle Zeilen zwischen der zuerst ausgewählten und der dann mit SHIFT+Klick ausgewählte Zeile ausgewählt und werden entsprechend markiert.</li> \n<li>Ist die Mehrfachauswahl von Spalten / Zeilen aktiviert und der Benutzer klickt in irgendeine Zelle dann wird die Mehrfach-Suchauswahl gelöscht und nur die gerade angeklickte Spalte wird der Suchauswahl hinzugefügt; in diesem Fall wird nur noch die Zeile mit der angeklickten Zelle markiert.</li> \n</ul>",
