    "agfilter.table.dialog.helpcontent": "Mit dieser Filter-Funktion lassen sich für jede Spalte einer Tabelle Filtereinstellungen festlegen.<br>\n<br>\nSind Filteroption für eine Tabelle in einem Portlet voreingestellt, so wird das kleine Filter-Symbol in der oberen rechten Ecke des Portlets mit einem türkisen Hintergrund angezeigt.<br>\n<br>\nSofern für eine Tabelle mehrere Reiter mit unterschiedlichen Ansichten der Daten einer Tabelle konfiguriert wurden, gelten die Filter-Einstellungen für alle diese Ansichten.<br>\nSofern unterschiedliche Filtereinstellungen gleichzeitig auf dieselbe Tabelle angewendet werden sollen bietet es sich an, die Tabelle in mehrere Portlets zu laden und in jedem Portlet unterschiedliche Filtereinstellungen zu konfigurieren.<br>\n<br>\nDie Filtereinstellungen werden auch nach dem Abmelden eines Benutzers gespeichert. Dies bedeutet, daß nach dem neuerlichen Einloggen, sogar auf einem anderen PC, dieselben Filtereinstellungen wieder voreingestellt sind.<br>\nNach dem Abmelden und neuerlichen Anmelden oder nach dem erneuten Laden einer Webseite werden die Daten der Tabelle zunächst nicht gefiltert und das Filter-Icon hat keinen türkisenen Hintergrund. Öffnet man dann jedoch die Filter-Einstellungen durch Anklicken des Filter-Icons, so werden die zuvor eingestellten Filtereinstellungen bereits vorgeschlagen und können mit einem einfachen Klick auf die Schaltfläche \"Anwenden\" erneut aktiviert werden.<br>\n<br>\nZum Anpassen der Filtereinstellungen bitte zunächst auf das Filter-Icon in der oberen rechten Ecke des Portlets klicken.<br>\n<br>\nZum Verschieben des sich öffnenden Filter-Dialogs an eine besser geeignete Stelle bitte den Mauszeiger über die Überschrift des Filter-Dialogs bewegen. Dort ändert sich der Mauszeiger in ein Symbol, das 4 Pfeile in vier unterschiedliche Richtungen zeigt. Nun bitte mit der linken Maustaste die Überschrift anklicken und die Maustaste gedrückt halten. Nun bitte den Filter-Dialog mit der Maus an die gewünschte Stelle verschieben und die Maustaste loslassen.<br>\n<br>\nAm oberen Rand des Filter-Dialogs befinden sich die folgenden Schaltflächen:<br>\n<br>",
