    "validate.value.required": "Wert erforderlich",
    "SAVE_PANEL_PROJECT_DESCRIPTION": "Bitte die App in wenigen Sätzen beschreiben…",
    "agfilter.table.dialog.helpcontent1": "Auf Werkseinstellungen zurücksetzen:<br>\nDurch Anklicken dieser Schaltfläche werden alle Filtereinstellungen auf Werkseinstellung zurückgesetzt: alle Filter werden geleert und Filter für eine Spalte mit dem Datentyp 'Datum' bzw. 'Datum und Uhrzeit' werden so vorbesetzt, wie es in den Voreinstellungen für die Tabelle festgelegt wurde.<br>\nWurde noch keine Festlegung bzgl. der Voreinstellung des 'Datum' bzw. 'Datum und Uhrzeit' Filters getroffen, so wird die Filtereinstellung \"Heute\" als Werkseinstellung verwendet. Sofern bereits eine Festlegung bzgl. der Voreinstellung des 'Datum' bzw. 'Datum und Uhrzeit' Filters erfolgt ist wird diese Einstellung als Werkseinstellung verwendet.<br>\nFilter für Spalten mit dem Datentyp 'Status' bzw.  mit dem Datentyp 'Unterschrift' werden auf die Voreinstellung 'Keine Auswahl' zurückgesetzt.<br>\n<br>\nFiltereinstellungen löschen:<br>\nDurch Anklicken dieser Schaltfläche werden alle Filter samt den Filtern für eine Spalte mit dem Datentyp 'Datum' bzw. 'Datum und Uhrzeit' geleert.<br>\n<br>\nAnwenden:<br>\nDurch Anklicken dieser Schaltfläche werden alle Filtereinstellungen auf die Tabelle im selben Portlet angewendet. Der Filterdialog wird nach dem Anklicken der Schaltfläche 'Anwenden' NICHT geschlossen. So lassen sich Änderungen an den Filtereinstellungen schnell erledigen und ausprobieren.<br>\nBitte auf das 'X' in der rechten oberen Ecke klicken um den Filterdialog zu schließen.<br>\n<br>",
