    "agGrid.import.dialog.help": "<p>Mit dieser Funktion lassen sich Daten von Ihrem PC in ginstr Tabellen hochladen.</p>\n<p>Dazu bitte die Tabelle mit der rechten Maustaste an einer beliebigen Stelle anklicken und dann &lsquo;Daten hochladen&rsquo; auswählen. Nun wird dieses Eingabefenster angezeigt, welches es ermöglicht, die Details des Hochladens von Daten festzulegen.</p>\n<p>ginstr web ordnet die hochgeladenen Daten den einzelnen Spalten einer Tabelle anhand der Tabellenüberschriften zu.<br />Um sicherzustellen, daß die Spaltenüberschriften in den hochzuladenden Dateien richtig und vollständig sind, empfehlen wir, die Tabelle zunächst herunterzuladen (auch wenn sie noch leer ist), und dann die Spaltenüberschriften aus dieser heruntergeladenen Tabelle zu nutzen beim Erstellen der Datei mit den hochzuladenden Daten.</p>\n<p>Folgende Optionen stehen für das Hochladen von Daten zur Verfügung:</p>\n<ul>\n<li>Daten hochladen<br />\nUm Daten in die ginstr cloud hochzuladen ist es nicht erforderlich auszuwählen, ob die hochzuladenden Daten zuvor mit oder ohne Anhänge heruntergeladen wurden; lediglich eine der folgenden Optionen muss ausgewählt werden:\n<ul>\n<ul>\n<li>Nur in diese Tabelle:<br />es werden nur Daten in diejenige Tabelle hochgeladen, die beim Öffnen dieses Fensters mit der rechten Maustaste angeklickt wurde</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li>In alle abhängigen Tabellen:<br />es werden Daten in diejenige Tabelle hochgeladen, die mit der rechten Maustaste angeklickt wurde, sowie in alle Tabellen, die mit dieser Tabelle durch die Datentypen \"Zeiger\" oder \"Zuordnung\" verknüpft sind</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li>In alle Tabellen dieser ginstr app:<br />es werden Daten in diejenige Tabelle hochgeladen, die mit der rechten Maustaste angeklickt wurde, sowie in alle Tabellen, die zur selben ginstr app gehören</li>\n</ul>\n</ul>\n<br />\n</li>\n",
